import React from 'react';
import logo from './logo.png';
// import logo-footer '.logoo.png';
import footerdcl from './footerdcl.svg';
import kadomstev from './kadomstev.png';
import './App.css';
import Containers from './Containers';     ///extra line to use button  
import Plot from 'react-plotly.js';
import raf from "raf";
import BezierEditor from "bezier-easing-editor";
import libPackage from "bezier-easing-editor/package.json";
import Point from './Point';
import SvgCubicSpline from './SvgCubicSpline';
const mathLib = require('./mathLib.js');


class App extends Component {

  constructor()
  {
    super();
    this.state = null;

    this.points = [ new Point(0,400), 
                    new Point(400,200),
                    new Point(650,400)];
  }

  render() {

    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <h1 className="App-title">Welcome to React for SplineCOMB</h1>
        </header>
        <p className="App-intro">
          Click in SVG to add a knot on the curve.
        </p>

        <SvgCubicSpline points={this.points}/>
      </div>
    );
  }
}

export default App;
